import React from "react";
import "../styles/RequestForm.css";

const RequestForm = () => {
    return ( 
        <div className="form-container">
            <div className="form-box-container">
                <div className="header">
                    <div className="logo"></div>
                    <h1>Nutra Tech</h1>
                </div>
            </div>
        </div>
    );
};

export default RequestForm;
